While you're pregnant you should keep your gums and teeth in healthy and clean condition. It's very important to you and baby. Symptoms like bleeding gums are common at this period of pregnancy. The best way to fix the gum problem is being good to your gums in a gentle way: 
- use a soft toothbrush; 
- clean gums margins; 
- use a water flosser; 
- use a tongue-scraper; 
- swish with warm water. 

Visit a dentist for a checkup, teeth cleaning and for help with your gums.
